import React, {Component} from 'react';

class Section extends Component {
    render() {
        return (
            <>
                <div className="main__backround">
                    <section>
                        <hr/>

                        <h2>projects I have done :</h2>
                    </section>
                </div>
            </>
        );
    }
}

export default Section;
